import React from "react";
import ReactDOM from "react-dom";

function Heading() {
  <h1>My name is Willy</h1>;
}
ReactDOM.render(
  <>
    <Heading />
    <h1>My name is Sushant Dahal</h1>
    <ul>
      <li>Sachin</li>
      <li>Swostika</li>
      <li>Suraj</li>
      <li>Rama</li>
    </ul>
  </>,
  document.getElementById("root")
);
